import { useEffect, useState } from "react";

function Map2() {

    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('https://jsonplaceholder.typicode.com/posts')
            .then((res) => res.json())
            .then(finalRes => setData(finalRes));
    }, [])
    return <section>
        {data.map(function(param){
            return(
                <div>
                    <h1>{param.id}</h1>
                </div>
            )
        })}
    </section>
}
export default Map2
